import React, { useState } from "react";
// import AgeCounter from "AgeCounter";

const AgeTotaller = () => {
  const [cats, setCats] = useState(["Garfield", "Ollie", "Tom", "Meowmeow"]);
  // console.log(cats);
  return (
    <div className="AgeTotaller">
      {cats.map((cat, index) => {
        console.log(cat);

        <div className="cats" key={index}>
          <h1>cat</h1>
        </div>;
      })}
    </div>
  );
};

export default AgeTotaller;
